import React from 'react';
import BasicTable from "./table.jsx";
const axios = require('axios');

class Player extends React.Component {
    constructor(props) {
        super(props);
        this.state ={
            tableHeaders: ['name', 'date', 'time'],
            tableData: [{name: 'tzach', date: '12/11/2020', time: '12:30'},
                {name: 'tzach', date: '12/11/2020', time: '12:30'}],
        }
    }
    componentDidMount() {
        this.getRecords();
    }

    async getRecords() {
        try {

            const res = await axios.get('http://localhost:5000/test_db/getRecords');
            const doesActionFailed = !(res && res.data && res.data.statusCode && res.data.statusCode === 200);
            if (doesActionFailed) {
            } else {
                this.setState({isToggleChecked: false});
            }
        } catch (ex) {
            console.log(ex)
        }
    }

    render() {
        return (
            <div>
                <BasicTable
                    tableHeaders={this.state.tableHeaders || []}
                    tableData={this.state.tableData || []}
                />
            </div>
        );
    }
}
export default Player;
